Memory allocation primitives.

This module provides types and behaviors for memory allocation, including
the [`Layout`] type for describing memory requirements and the [`Allocator`]
behavior for custom allocators.

# Core Types

| Type | Description |
|------|-------------|
| [`Layout`] | Describes size and alignment requirements for memory |
| [`LayoutError`] | Error when creating an invalid layout |
| [`AllocError`] | Error when allocation fails |

# Allocator Behavior

The [`Allocator`] behavior allows implementing custom memory allocators:

```tml
use core::alloc::{Allocator, Layout, AllocError}

type MyAllocator { ... }

impl Allocator for MyAllocator {
    func allocate(mut this, layout: Layout) -> Outcome[RawPtr[U8], AllocError] {
        // Custom allocation logic
    }

    lowlevel func deallocate(mut this, ptr: RawPtr[U8], layout: Layout) {
        // Custom deallocation logic
    }
}
```

# Layout

[`Layout`] describes the memory requirements of a type or value:

```tml
use core::alloc::Layout

// Create a layout for 100 bytes with 8-byte alignment
let layout = Layout::from_size_align(100, 8)!

// Get layout for a specific type
let i32_layout = Layout::new[I32]()
assert_eq(i32_layout.size(), 4)
assert_eq(i32_layout.align(), 4)
```

Asynchronous iterators (async streams).

This module provides the [`AsyncIterator`] behavior, which is the async
equivalent of [`Iterator`]. An async iterator produces a sequence of values
asynchronously, allowing for efficient streaming of data.

# The AsyncIterator Behavior

[`AsyncIterator`] is similar to [`Iterator`], but its `poll_next` method
returns `Poll[Maybe[Item]]` instead of `Maybe[Item]`, allowing for
asynchronous iteration.

```tml
use core::async_iter::AsyncIterator
use core::task::{Context, Poll}
use core::pin::Pin

type Counter {
    count: I64,
    max: I64
}

impl AsyncIterator for Counter {
    type Item = I64

    func poll_next(
        mut this: Pin[mut ref This],
        cx: mut ref Context
    ) -> Poll[Maybe[I64]] {
        this.count = this.count + 1
        if this.count <= this.max {
            return Poll::Ready(Just(this.count))
        }
        return Poll::Ready(Nothing)
    }
}
```

# Async For Loops

Async iterators can be consumed with async for loops:

```tml
async func process_stream[S: AsyncIterator](stream: S) {
    for await item in stream {
        process(item)
    }
}
```

# Differences from Iterator

| Aspect | Iterator | AsyncIterator |
|--------|----------|---------------|
| Method | `next()` returns `Maybe[Item]` | `poll_next()` returns `Poll[Maybe[Item]]` |
| Blocking | Blocks until next item | Returns `Pending` if not ready |
| Pinning | No pinning required | Requires `Pin[mut ref Self]` |
| Usage | `for` loops | `for await` loops |

# Creating Async Iterators

## From a Future

```tml
use core::async_iter::from_iter

// Convert a regular iterator into an async one
let async_iter = from_iter([1, 2, 3, 4, 5].iter())
```

## Using Generators (when supported)

```tml
async gen func countdown(from: I64) -> I64 {
    var i: I64 = from
    loop {
        if i <= 0 { break }
        yield i
        i = i - 1
    }
}
```

# Size Hints

Like synchronous iterators, async iterators provide `size_hint()` to
give bounds on the remaining number of items:

```tml
let (lower, upper) = stream.size_hint()
// lower: guaranteed minimum items
// upper: optional maximum items
```

Utilities for comparing and ordering values.

This module contains various tools for comparing and ordering values. In
summary:

- [`Ordering`] is an enum returned by the main comparison functions,
  which has three possible values: `Less`, `Equal`, and `Greater`.
- [`PartialEq`] and [`PartialOrd`] are behaviors that allow you to define
  partial equality and ordering relationships.
- [`Eq`] and [`Ord`] are behaviors for types with full equality and total
  ordering.
- [`max`] and [`min`] are functions that return the maximum or minimum
  of two values.

# Examples

Implementing comparison for a custom type:

```tml
type Person {
    name: Str,
    age: I32
}

impl PartialEq for Person {
    func eq(this, other: ref Person) -> Bool {
        return this.name == other.name and this.age == other.age
    }
}

impl Eq for Person {}

impl PartialOrd for Person {
    func partial_cmp(this, other: ref Person) -> Maybe[Ordering] {
        return Just(this.age.cmp(ref other.age))
    }
}

impl Ord for Person {
    func cmp(this, other: ref Person) -> Ordering {
        return this.age.cmp(ref other.age)
    }
}
```

